import React, { Component } from 'react';
import Social from './Social';
import logo from '../logo.svg';

class App extends Component {
  render() {
    return (
      <div className="container">
        <span className="header">
          <img src={logo} className="logo" alt="logo" />
          <h1>DUBZOO</h1>
        </span>
        <Social />
      </div>
    );
  }
}

export default App;
